wer a digital world economy",description:"Ethereum is redefining digital trust through Trustware, a new framework for programmable, verifiable coordination in an increasingly online world.",keywords:["Trust","Trustware","Ethereum","Consensys"],sharedImage:{metadata:{tags:[],concepts:[]},sys:{space:{sys:{type:"Link",linkType:"Space",id:"gjyjx7gst9lo"}},id:"1nLBsOQCCjudEA4913D5Vs",type:"Asset",createdAt:"2025-07-15T16:28:14.327Z",updatedAt:"2025-07-15T16:28:14.327Z",environment:{sys:{id:"master",type:"Link",linkType:"Environment"}},publishedVersion:4,revision:1,locale:"en-US"},fields:{title:"Trustware shared image",description:"",file:{url:"//images.ctfassets.net/gjyjx7gst9lo/1nLBsOQCCjudEA4913D5Vs/138f8cc924ee81b301cff33b087916bd/trustware-report__Meta_1x.png",details:{size:559996,image:{width:1200,height:630}},fileName:"trustware-report__Meta@1x.png",contentType:"image/png"}}},no_index:false,no_follow:false}},articleTag:[j],date:"2025-07-16",thumbnail:{metadata:{tags:[],concepts:[]},sys:{space:{sys:{type:"Link",linkType:"Space",id:"gjyjx7gst9lo"}},id:"2umOzl9PM1tUHK4RJk2ArG",type:"Asset",createdAt:"2025-07-15T16:11:21.862Z",updatedAt:"2025-07-15T16:11:21.862Z",environment:{sys:{id:"master",type:"Link",linkType:"Environment"}},publishedVersion:7,revision:1,locale:"en-US"},fields:{title:"Trustware blog thumbnail image",description:"",file:{url:"//images.ctfassets.net/gjyjx7gst9lo/2umOzl9PM1tUHK4RJk2ArG/bbd235edcd18592ccf848420934940c7/trustware-report_thumb.png",details:{size:3869711,image:{width:2160,height:2160}},fileName:"trustware-report_thumb.png",contentType:"image/png"}}},coverImage:{metadata:{tags:[],concepts:[]},sys:{space:{sys:{type:"Link",linkType:"Space",id:"gjyjx7gst9lo"}},id:"4UDvLtLCiGP7scyiIzFmBb",type:"Asset",createdAt:"2025-07-15T16:15:30.192Z",updatedAt:"2025-07-15T16:15:30.192Z",environment:{sys:{id:"master",type:"Link",linkType:"Environment"}},publishedVersion:4,revision:1,locale:"en-US"},fields:{title:"Trustware blog cover image",description:"",file:{url:"//images.ctfassets.net/gjyjx7gst9lo/4UDvLtLCiGP7scyiIzFmBb/a9421e14e159a086f4a9f68caa07432e/trustware-report_hero.png",details:{size:6075951,image:{width:3840,height:2160}},fileName:"trustware-report_hero.png",contentType:"image/png"}}},readTime:"3 Mins",introductionText:"Ethereum is digital trust: Trustware is a technology layer for programmable, verifiable coordination in an increasingly online world.",body:[{metadata:{tags:[],concepts:[]},sys:{space:{sys:{type:"Link",linkType:"Space",id:"gjyjx7gst9lo"}},id:"3yRpaEJAR76q1Y1nXWt3Xj",type:"Entry",createdAt:"2025-07-15T16:04:49.984Z",updatedAt:"2025-07-16T13:19:34.942Z",environment:{sys:{id:"master",type:"Link",linkType:"Environment"}},publishedVersion:16,revision:4,contentType:{sys:{type:"Link",linkType:"ContentType",id:"articleModuleText"}},locale:"en-US"},fields:{name:"Trustware Blog Body 1",text:{data:{},content:[{data:{},content:[{data:{},marks:[],value:"Every financial transaction contains within it an element of trust. Ethereum’s digital trust is allowing vast quantities of assets, capital, and financial transactions to be digitized, unlocking tremendous efficiencies for the global financial system and benefiting everyone from institutions to enterprises to consumers. ",nodeType:"text"}],nodeType:"paragraph"},{data:{},content:[{data:{},marks:[],value:"As we approach the 10-year anniversary of Ethereum on July 30, Consensys is releasing The Industrialization of Trust, a detailed report outlining the investment case for Ethereum and the new technological category of ",nodeType:"text"},{data:{},marks:[{type:"italic"}],value:"Trustware",nodeType:"text"},{data:{},marks:[],value:". Trustware is infrastructure that industrializes the production of trust, allowing it to be encoded in the form of a digital commodity. Our research and analysis demonstrates how Ethereum has become the dominant blockchain platform, underpinning more than 50% of all non-Bitcoin digital assets, including 60% of stablecoins, 60% of all capital used in decentralized finance, and 80% of all tokenized “real world assets,” like stocks, money market funds, and bonds.",nodeType:"text"}],nodeType:"paragraph"},{data:{},content:[{data:{},marks:[],value:"You can download the ",nodeType:"text"},{data:{uri:"http://consensys.io/ethereum/trust"},content:[{data:{},marks:[{type:"underline"}],value:"full report here",nodeType:"text"}],nodeType:"hyperlink"},{data:{},marks:[],value:" or read on for a quick look at the limitations of traditional trust, how Trustware and digital trust has emerged to solve those limitations, and the multi-trillion-dollar opportunity ahead for Ethereum. ",nodeType:"text"}],nodeType:"paragraph"},{data:{},content:[{data:{},marks:[{type:"bold"}],value:"Ethereum’s Breakthrough: Digital Trust and Trustware",nodeType:"text"}],nodeType:"paragraph"},{data:{},content:[{data:{},marks:[{type:"italic"},{type:"bold"}],value:"Trustware is the infrastructure that enables an upgrade from analog concepts of trust, like notes and ledgers verified by human agents and auditors, guaranteed by human insurers and regulators, to an equivalent digital concept of trust that can be generated algorithmically. ",nodeType:"text"}],nodeType:"paragraph"},{data:{},content:[{data:{},marks:[],value:"For centuries, human civilization has relied on various forms of trust infrastructure, from tribal kinship to large institutions like governments, insurance companies, auditors, and legal systems. While these systems enable cooperation and economic growth, they come at an immense cost. Annually, it’s estimated that humanity spends ",nodeType:"text"},{data:{},marks:[{type:"bold"}],value:"over $9 trillion on trust-related expenses",nodeType:"text"},{data:{},marks:[],value:", including insurance ($8.0 trillion), legal systems ($1.0+ trillion), and auditing ($290 billion). This colossal expenditure highlights a fundamental issue: current models of trust don’t scale efficiently for the digital age. They are analog – slower, more expensive, more fragmented than the always-on, largely automated, and rapidly accelerating digital economy that relies on them.",nodeType:"text"}],nodeType:"paragraph"},{data:{},content:[{data:{},marks:[],value:"Trustware imbues ordinary data with the essential qualities of trust – validity and finality, in a completely algorithmic process. Validity guarantees that data is consistent and correct, with mathematical certainty. Finality guarantees that it is permanent and cannot be changed except at immense cost. Ethereum allows these properties to be added to data in a scalable way, without continuous human intervention, achieving trust with near-zero marginal cost. In this way, through its powerful public network and breakthrough cryptoeconomic algorithms that generate digital trust, Ethereum is able to make the verification of financial transactions, the world’s largest consumer of trust, radically better in speed, in cost, in safety, and in scale, all at the same time.",nodeType:"text"}],nodeType:"paragraph"},{data:{},content:[{data:{},marks:[{type:"bold"}],value:"The investment case",nodeType:"text"}],nodeType:"paragraph"},{data:{},content:[{data:{},marks:[],value:"For years, investors have learned about how ETH was the “second largest cryptocurrency.” It’s true, but it doesn’t say much. Today, they are learning that ETH is the proxy for the explosive growth of stablecoins and other tokenized assets that they are seeing talked about on business channels every day, and maybe already using in their daily lives. They are learning that ETH is what powers the prediction markets they see online and in the news, that ETH powers the new tokenized equities that Robinhood is launching. And with landmark proposed legislation like the GENIUS and CLARITY acts, this wave of innovation is only going to build. Ethereum’s role as the platform that drives the future global economy is gaining more attention every day.",nodeType:"text"}],nodeType:"paragraph"},{data:{},content:[{data:{},marks:[],value:"From the beginning, Ethereum has been built for this moment. Ethereum is in a category of one when it comes to safety, security, and resilience. The 10 year anniversary of the genesis block is also a celebration of a 10 year track record unmatched in either digital or traditional asset technology.",nodeType:"text"}],nodeType:"paragraph"},{data:{},content:[{data:{},content:[{data:{},content:[{data:{},marks:[{type:"bold"}],value:"Unmatched Economic Security:",nodeType:"text"},{data:{},marks:[],value:" With ",nodeType:"text"},{data:{},marks:[{type:"bold"}],value:"$100B+ in staked capital",nodeType:"text"},{data:{},marks:[],value:" and over 1 million validators, Ethereum creates a formidable defense against attacks.",nodeType:"text"}],nodeType:"paragraph"}],nodeType:"list-item"},{data:{},content:[{data:{},content:[{data:{},marks:[{type:"bold"}],value:"Robust Network Effects:",nodeType:"text"},{data:{},marks:[],value:" Ethereum hosts the deepest liquidity, the most developers (2x more than the next closest chain), and the richest ecosystem of applications. The EVM (Ethereum Virtual Machine) standard dominates smart contract development, and every major stablecoin uses Ethereum as its primary platform.",nodeType:"text"}],nodeType:"paragraph"}],nodeType:"list-item"},{data:{},content:[{data:{},content:[{data:{},marks:[{type:"bold"}],value:"Proven Adaptability and Continuous Upgrades:",nodeType:"text"},{data:{},marks:[],value:" Through complex upgrades like The Merge (transition to proof-of-stake with 99.95% energy reduction) and Dencun (cutting rollup fees by 90%), Ethereum has demonstrated",nodeType:"text"},{data:{},marks:[{type:"bold"}],value:" ",nodeType:"text"},{data:{},marks:[],value:"resilience and continuous improvement without any downtime over its first decade",nodeType:"text"},{data:{},marks:[{type:"bold"}],value:".",nodeType:"text"},{data:{},marks:[],value:" ",nodeType:"text"}],nodeType:"paragraph"}],nodeType:"list-item"},{data:{},content:[{data:{},content:[{data:{},marks:[{type:"bold"}],value:"Global Neutrality and Decentralization:",nodeType:"text"},{data:{},marks:[],value:" Unlike other chains that concentrate power, Ethereum is not controlled by a single company or entity. Its 1 million+ validators operate across 80+ countries, with over 67% of nodes running outside the U.S., proving its antifragility and credible neutrality.",nodeType:"text"}],nodeType:"paragraph"}],nodeType:"list-item"},{data:{},content:[{data:{},content:[{data:{},marks:[{type:"bold"}],value:"Institutional Validation and Adoption:",nodeType:"text"},{data:{},marks:[],value:" Global institutions like ",nodeType:"text"},{data:{},marks:[{type:"bold"}],value:"BlackRock, JPMorgan, Visa, and Franklin Templeton",nodeType:"text"},{data:{},marks:[],value:" are already leveraging Ethereum for tokenized assets, payments, and private equity access, validating its security model and reliability. Tokenized real-world assets on Ethereum's rails crossed $13 billion, growing at an extraordinary 6.75% a month.",nodeType:"text"}],nodeType:"paragraph"}],nodeType:"list-item"}],nodeType:"unordered-list"},{data:{},content:[{data:{},marks:[],value:"Despite its technical maturity, and progress consolidating the market for digital asset infrastructure, Ethereum is still in the early stages of its economic potential. Total crypto market cap represents only 0.3% of global wealth, and tokenized securities capture a tiny fraction of capital markets. However, increased regulatory clarity, particularly in major economies like the US, is accelerating adoption, shifting from resistance to embracing digital assets. The convergence of artificial intelligence (AI) with blockchain creates unprecedented demand for trustless infrastructure: as AI agents begin transacting at machine speed, they'll need machine trust. Ethereum is the only infrastructure ready for an economy where algorithms need to trust each other.",nodeType:"text"}],nodeType:"paragraph"},{data:{},content:[{data:{},marks:[],value:"For institutions, holding Ether (ETH) offers ownership in the foundational infrastructure of the digital economy at a fraction of its terminal value. ETH is spendable to pay for transactions on the network and acts as a store of value, but unlike Bitcoin, ETH also generates cash flow through staking, and like equities, ETH’s value grows as the Ethereum platform gains adoption. It combines properties of commodities, currencies, and capital assets into a unique and compelling asset of its own. And as the Trustware report makes clear, the role of ETH as the economic bandwidth that secures the assets expected to be issued and transacted on platform over the coming years, will drive powerful value accretion.",nodeType:"text"}],nodeType:"paragraph"},{data:{},content:[{data:{},marks:[],value:"The trust machine has been built. It runs continuously, improving itself, securing ever more value, attracting ever more users. The question is not whether to believe in Ethereum. The question is whether to believe in the digitization of trust. If so, the investment case for owning a portion of the base layer of the future global economy, writes itself.",nodeType:"text"}],nodeType:"paragraph"},{data:{},content:[{data:{},marks:[],value:"To delve deeper into the economics and valuation framework, we encourage you to ",nodeType:"text"},{data:{uri:"http://consensys.io/ethereum/trust"},content:[{data:{},marks:[{type:"underline"},{type:"bold"}],value:"read the full report: The Industrialization of Trust.",nodeType:"text"}],nodeType:"hyperlink"},{data:{},marks:[],value:"",nodeType:"text"}],nodeType:"paragraph"}],nodeType:"document"}}}],author:{metadata:{tags:[],concepts:[]},sys:{space:{sys:{type:"Link",linkType:"Space",id:"gjyjx7gst9lo"}},id:"096y32nLC0FXJdRDGrcCf",type:"Entry",createdAt:"2023-10-13T16:30:22.874Z",updatedAt:"2023-10-13T18:06:53.753Z",environment:{sys:{id:"master",type:"Link",linkType:"Environment"}},publishedVersion:5,revision:2,contentType:{sys:{type:"Link",linkType:"ContentType",id:"author"}},locale:"en-US"},fields:{name:"Consensys"}},associatedProduct:{metadata:{tags:[],concepts:[]},sys:{space:{sys:{type:"Link",linkType:"Space",id:"gjyjx7gst9lo"}},id:"5pGAhICZtZiU95IS1Tbcjb",type:"Entry",createdAt:"2023-10-12T03:25:46.360Z",updatedAt:"2023-10-12T03:25:46.360Z",environment:{sys:{id:"master",type:"Link",linkType:"Environment"}},publishedVersion:3,revision:1,contentType:{sys:{type:"Link",linkType:"ContentType",id:"product"}},locale:"en-US"},fields:{title:"Ethereum",logo:{metadata:{tags:[],concepts:[]},sys:{space:{sys:{type:"Link",linkType:"Space",id:"gjyjx7gst9lo"}},id:"2n3BRxWioznWFBBVFJJ2Gp",type:"Asset",createdAt:"2023-10-12T03:25:41.292Z",updatedAt:"2023-10-12T03:25:41.292Z",environment:{sys:{id:"master",type:"Link",linkType:"Environment"}},publishedVersion:3,revision:1,locale:"en-US"},fields:{title:"eth-icon",description:"",file:{url:"//images.ctfassets.net/gjyjx7gst9lo/2n3BRxWioznWFBBVFJJ2Gp/c4eb3b85b04c5973853091aa3963ef72/eth-icon.svg",details:{size:494,image:{width:34,height:53}},fileName:"eth-icon.svg",contentType:"image/svg+xml"}}},text:"Core protocol (Proof-of-Stake) design, testing, and development"}},mainColor:{metadata:{tags:[],concepts:[]},sys:{space:{sys:{type:"Link",linkType:"Space",id:"gjyjx7gst9lo"}},id:"48eX85IVA4o0mwwYPtQCov",type:"Entry",createdAt:"2024-10-28T08:47:24.293Z",updatedAt:"2024-10-28T08:47:24.293Z",environment:{sys:{id:"master",type:"Link",linkType:"Environment"}},publishedVersion:2,revision:1,contentType:{sys:{type:"Link",linkType:"ContentType",id:"colorPicker"}},locale:"en-US"},fields:{name:"Color Blue",colors:"blue"}},heroSplitView:false,showIntroductionTextBelowHero:false,tags:["Trust","Trustware","Ethereum","Consensys"]}},{metadata:{tags:[],concepts:[]},sys:{space:{sys:{type:"Link",linkType:"Space",id:"gjyjx7gst9lo"}},id:"2tRo2pDtuejbVzDcyJGILv",type:"Entry",createdAt:"2025-06-02T12:32:31.802Z",updatedAt:"2025-07-21T14:20:02.414Z",environment:{sys:{id:"master",type:"Link",linkType:"Environment"}},publishedVersion:31,revision:6,contentType:{sys:{type:"Link",linkType:"ContentType",id:"pageArticle"}},locale:"en-US"},fields:{title:"Consensys leads $425,000,000 private placement into SharpLink to bring Ethereum to the global economy",slug:"consensys-leads-usd425-000-000-private-placement-into-sharplink-to-bring",seo:{metadata:{tags:[],concepts:[]},sys:{space:{sys:{type:"Link",linkType:"Space",id:"gjyjx7gst9lo"}},id:"75zsBTDiSPVArGlSej6SpK",type:"Entry",createdAt:"2025-06-02T03:34:53.266Z",updatedAt:"2025-07-21T14:20:18.159Z",environment:{sys:{id:"master",type:"Link",linkType:"Environment"}},publishedVersion:26,revision:2,contentType:{sys:{type:"Link",linkType:"ContentType",id:"seo"}},locale:"en-US"},fields:{name:"SEO Metadata - SharpLink Consensys blog announcement",title:"Consensys leads $425,000,000 private placement into SharpLink",description:"Consensys announces its role as the lead investor in SharpLink Gaming’s $425,000,000 fundraise, alongside leading crypto funds and protocols. ",keywords:["Consensys","ethereum","sharplink","eth","Joseph Lubin"],sharedImage:{metadata:{tags:[],concepts:[]},sys:{space:{sys:{type:"Link",linkType:"Space",id:"gjyjx7gst9lo"}},id:"BCfjMdmDb453NRmdgFYHy",type:"Asset",createdAt:"2025-05-01T14:25:28.569Z",updatedAt:"2025-05-01T14:25:28.569Z",environment:{sys:{id:"master",type:"Link",linkType:"Environment"}},publishedVersion:4,revision:1,locale:"en-US"},fields:{title:"Consensys grayscale logo",description:"Consensys grayscale logo",file:{url:"//images.ctfassets.net/gjyjx7gst9lo/BCfjMdmDb453NRmdgFYHy/db5ade6706f660c038cda01c6ff60fae/Consensys_Symbol_Gray__Share_.png",details:{size:28769,image:{width:2400,height:1260}},fileName:"Consensys_Symbol_Gray (Share).png",contentType:"image/png"}}},no_index:false,no_follow:false}},articleTag:[j],date:"2025-06-02",thumbnail:{metadata:{tags:[],concepts:[]},sys:{space:{sys:{type:"Link",linkType:"Space",id:"gjyjx7gst9lo"}},id:"7rilgpnBHoAJNx9RKPNz1L",type:"Asset",createdAt:"2025-05-08T03:38:27.129Z",updatedAt:"2025-05-08T03:38:27.129Z",environment:{sys:{id:"master",type:"Link",linkType:"Environment"}},publishedVersion:3,revision:1,locale:"en-US"},fields:{title:"consensys-thumbnail-gray",description:"",file:{url:"//images.ctfassets.net/gjyjx7gst9lo/7rilgpnBHoAJNx9RKPNz1L/4edf066e2c4dfd397b0ce2d7f06903f0/consensys-thumbnail-gray.png",details:{size:34157,image:{width:2161,height:2160}},fileName:"consensys-thumbnail-gray.png",contentType:"image/png"}}},coverImage:{metadata:{tags:[],concepts:[]},sys:{space:{sys:{type:"Link",linkType:"Space",id:"gjyjx7gst9lo"}},id:"3FrCkcT4gVMBY29kyyNxSB",type:"Asset",createdAt:"2025-05-01T14:24:56.931Z",updatedAt:"2025-05-01T14:24:56.931Z",environment:{sys:{id:"master",type:"Link",linkType:"Environment"}},publishedVersion:5,revision:1,locale:"en-US"},fields:{title:"Consensys grayscale logo",description:"Consensys grayscale logo",file:{url:"//images.ctfassets.net/gjyjx7gst9lo/3FrCkcT4gVMBY29kyyNxSB/ae7c4745e95e4ef23ba67c02f5ced51e/Consensys_Symbol_Gray__16x9_.png",details:{size:65980,image:{width:3841,height:2160}},fileName:"Consensys_Symbol_Gray (16x9).png",contentType:"image/png"}}},readTime:"2 min",introductionText:"Consensys announces its role as the lead investor in SharpLink Gaming’s $425,000,000 fundraise, alongside leading crypto funds and protocols.",body:[{metadata:{tags:[],concepts:[]},sys:{space:{sys:{type:"Link",linkType:"Space",id:"gjyjx7gst9lo"}},id:"5qN5Kv2qc7AGvn0TEmOIKN",type:"Entry",createdAt:"2025-06-02T03:26:44.210Z",updatedAt:"2025-06-02T12:32:18.506Z",environment:{sys:{id:"master",type:"Link",linkType:"Environment"}},publishedVersion:10,revision:2,contentType:{sys:{type:"Link",linkType:"ContentType",id:"articleModuleText"}},locale:"en-US"},fields:{name:"SharpLink Consensys blog announcement body text",text:{nodeType:"document",data:{},content:[{nodeType:"paragraph",data:{},content:[{nodeType:"text",value:"For nearly a decade, Consensys has helped build Ethereum into the foundation for a more open, resilient, and powerful global economic system. Today, the momentum behind this transformation is unmistakable—as our founder and Ethereum co-founder Joseph Lubin wrote in the ",marks:[],data:{}},{nodeType:"hyperlink",data:{uri:"https://www.ft.com/content/11c4973a-d798-4819-b342-fcffa4146f3d"},content:[{nodeType:"text",value:"Financial Times",marks:[{type:"underline"}],data:{}}]},{nodeType:"text",value:" last week: ",marks:[],data:{}},{nodeType:"text",value:"The technology is no longer speculative. It is operational.",marks:[{type:"italic"}],data:{}},{nodeType:"text",value:" ",marks:[],data:{}}]},{nodeType:"paragraph",data:{},content:[{nodeType:"text",value:"In that spirit, we’re proud to announce our role as the ",marks:[],data:{}},{nodeType:"text",value:"lead investor",marks:[{type:"bold"}],data:{}},{nodeType:"text",value:" in SharpLink Gaming’s ",marks:[],data:{}},{nodeType:"text",value:"$425,000,000 fundraise, ",marks:[{type:"bold"}],data:{}},{nodeType:"text",value:"alongside leading crypto funds and protocols. SharpLink intends to use the proceeds to purchase ETH, Ethereum’s native asset, and adopt it as their primary treasury reserve asset. This marks an expansion of SharpLink’s strategy and signals growing recognition of Ethereum’s role in the global economy, as well as the ways companies and individuals can be involved.",marks:[],data:{}}]},{nodeType:"heading-3",data:{},content:[{nodeType:"text",value:"Building an Ethereum Treasury Strategy",marks:[{type:"bold"}],data:{}}]},{nodeType:"paragraph",data:{},content:[{nodeType:"text",value:"SharpLink Gaming (NASDAQ: SBET) is a public company aligned with our vision of Ethereum as a new kind of economic infrastructure forming the ",marks:[],data:{}},{nodeType:"text",value:"trust layer of the internet",marks:[{type:"bold"}],data:{}},{nodeType:"text",value:". SharpLink’s use of proceeds to purchase ETH reflect our shared, deep confidence in Ethereum as the foundation of a programmable global economy. We believe Ethereum, and its robust economy for staking, restaking, and decentralized finance (DeFi), present structurally superior opportunities for SBET in both treasury management and ecosystem growth, especially when compared to what currently exists in the public market.",marks:[],data:{}}]},{nodeType:"paragraph",data:{},content:[{nodeType:"text",value:"As part of this strategic partnership, ",marks:[],data:{}},{nodeType:"text",value:"Joseph Lubin",marks:[{type:"bold"}],data:{}},{nodeType:"text",value:", Founder and CEO of Consensys and Co-Founder of Ethereum, will become Chairman of SharpLink upon the closing of the fundraise. His leadership and expertise will help guide SharpLink’s integration of Ethereum into its core operations and long-term vision. The collaboration represents a powerful alignment between pioneering leadership, capital markets, and cutting-edge blockchain infrastructure.",marks:[],data:{}}]},{nodeType:"paragraph",data:{},content:[{nodeType:"text",value:"SharpLink’s leadership team, backed by leading investors such as ParaFi, Pantera, Galaxy, and Electric Capital, joins a growing cohort of forward-thinking institutions leveraging Ethereum as a globally-accessible reserve asset with immense long-term value.",marks:[],data:{}}]},{nodeType:"heading-3",data:{},content:[{nodeType:"text",value:"Ethereum: The new protocol for global finance",marks:[{type:"bold"}],data:{}}]},{nodeType:"paragraph",data:{},content:[{nodeType:"text",value:"Ethereum is solidifying its position as the bedrock of a new foundational financial protocol - one capable of replacing the friction and fragmentation of legacy systems with seamless digital settlement, programmable assets, and neutral global interoperability.",marks:[],data:{}}]},{nodeType:"paragraph",data:{},content:[{nodeType:"text",value:"This shift from the age of gold, ink, and paper to a digital-native economy paves the way for lower costs, faster innovation, and greater sovereignty over value, assets, and even identity.",marks:[],data:{}}]},{nodeType:"paragraph",data:{},content:[{nodeType:"text",value:"Already, Ethereum has achieved massive real-world scale. In the past year, over $14.2 trillion in stablecoin transactions were securely settled on Ethereum, which hosts over half of the stablecoin supply. Ethereum boasts the deepest liquidity and the richest ecosystem of applications. Over 65 percent of DeFi total value locked resides on Ethereum or its Layer 2s. Institutional pioneers are already moving billions in tokenized assets onto Ethereum. And the developer ecosystem—the largest in the industry—continues to expand the frontier.",marks:[],data:{}}]},{nodeType:"paragraph",data:{},content:[{nodeType:"text",value:"We envision a future where Ethereum underpins everything from tokenized real-world assets and decentralized finance to AI-driven commerce and global remittances. Soon, settlement will be open, composable, and interoperable—transformational not just for finance, but for society.",marks:[],data:{}}]}]}}}],heroSplitView:false,showIntroductionTextBelowHero:false}}],disableSubmenuOnMobile:true,menuIcon:"<svg width="180" height="180" viewBox="0 0 180 180" fill="none" xmlns="http://www.w3.org/2000/svg" overflow="hidden">
